    <div className={styles.container}>
      <p>$ EUR</p>
      <p>$ EUR</p>
      <p>$ EUR</p>
      <p>$ EUR</p>
      <p>$ EUR</p>
    </div>
  );
};

export default CurrencySwitcher;
